style.css:
@-moz-document domain("www.mathworks.com") {
div#content_container {
    max-width: 800px;
    font: 18px/27px "Droid Serif", serif;
  }

#doc_center_content {
    font: 18px/27px "Droid Serif", serif;
}

#doc_center_content h3 {
    font: normal normal 24px/38.8328px "Droid Sans", Helvetica, sans-serif;
}

#doc_center_content h4 {
    font: normal bold 18px/27px "Droid Sans", Helvetica, sans-serif;
}

#doc_center_content pre, #doc_center_content code {
    font-family: "Cousine", "Droid Sans Mono";
}
}
